import random
import PySimpleGUI as sg
import webbrowser
from datetime import datetime





class GUI ():
    def __init__(self):


        self.img_100 = b""
        self.img_20 = b''
        self.img_12 = b''
        self.img_10 = b''
        self.img_8 = b''
        self.img_6 = b''
        self.img_4 = b''

        sg.theme('DarkAmber')
        self.layout = [
                        [sg.Button("LOG", key="LOG"), sg.Button("Reset slider", key="RESET")],
                       [sg.Text('[ ] / [ ]', size=(30, 1), font=("Helvetica", 25), justification='center', key="TEXT")],
                       [sg.Checkbox('Advantage', default=True, key='Advantage')],
                       [
                           sg.ReadFormButton('', button_color=sg.theme_background_color(), key='100',
                                            image_data=self.img_100, image_size=(100, 100), image_subsample=1, border_width=0),
                           sg.Slider(range=(-15, 15), key='SLIDER_100', default_value=0, size=(20, 20), orientation='horizontal', font=("Helvetica", 15))
                       ],
                       [
                           sg.ReadFormButton('', button_color=sg.theme_background_color(), key='20',
                                          image_data=self.img_20, image_size=(100, 100), image_subsample=0,
                                          border_width=0),
                            sg.Slider(range=(-15, 15), key='SLIDER_20', default_value=0, size=(20, 20), orientation='horizontal',
                                  font=("Helvetica", 15))
                       ],
                       [
                           sg.ReadFormButton('', button_color=sg.theme_background_color(), key='12',
                                             image_data=self.img_12, image_size=(100, 100), image_subsample=0,
                                             border_width=0),
                           sg.Slider(range=(-15, 15), key='SLIDER_12', default_value=0, size=(20, 20), orientation='horizontal',
                                     font=("Helvetica", 15))
                       ],
                       [
                           sg.ReadFormButton('', button_color=sg.theme_background_color(), key='10',
                                             image_data=self.img_10, image_size=(100, 100), image_subsample=0,
                                             border_width=0),
                           sg.Slider(range=(-15, 15), key='SLIDER_10', default_value=0, size=(20, 20), orientation='horizontal',
                                     font=("Helvetica", 15))
                       ],
                       [
                           sg.ReadFormButton('', button_color=sg.theme_background_color(), key='8',
                                             image_data=self.img_8, image_size=(100, 100), image_subsample=0,
                                             border_width=0),
                           sg.Slider(range=(-15, 15), key='SLIDER_8', default_value=0, size=(20, 20), orientation='horizontal',
                                     font=("Helvetica", 15))
                       ],
                       [
                           sg.ReadFormButton('', button_color=sg.theme_background_color(), key='6',
                                             image_data=self.img_6, image_size=(100, 100), image_subsample=0,
                                             border_width=0),
                           sg.Slider(range=(-15, 15), key='SLIDER_6', default_value=0, size=(20, 20), orientation='horizontal',
                                     font=("Helvetica", 15))
                       ],
                       [
                           sg.ReadFormButton('', button_color=sg.theme_background_color(), key='4',
                                             image_data=self.img_4, image_size=(100, 100), image_subsample=0,
                                             border_width=0),
                           sg.Slider(range=(-15, 15), key='SLIDER_4', default_value=0, size=(20, 20), orientation='horizontal',
                                     font=("Helvetica", 15))
                       ],
                       [sg.Text('TJ 2021 V1.0 https://dungeon-supporter.de', click_submits=True, key="LINK")]]

    def start(self):
        self.window = sg.Window('Quangler - Quick Strangler', self.layout, icon=self.img_20,size=(290, 900), resizable=True,finalize=True)
        while True:
            button, values = self.window.read()
            if button is '100':
                self.output(100, int(values['SLIDER_100']), values['Advantage'])
            elif button is '20':
                self.output(20, int(values['SLIDER_20']), values['Advantage'])
            elif button is '12':
                self.output(12, int(values['SLIDER_12']), values['Advantage'])
            elif button is '10':
                self.output(10, int(values['SLIDER_10']), values['Advantage'])
            elif button is '8':
                self.output(8, int(values['SLIDER_8']), values['Advantage'])
            elif button is '6':
                self.output(6, int(values['SLIDER_6']), values['Advantage'])
            elif button is '4':
                self.output(4, int(values['SLIDER_4']), values['Advantage'])
            elif button is 'LOG':
                self.popup()
            elif button is 'RESET':
                self.window.Element('SLIDER_100').Update(value=0)
                self.window.Element('SLIDER_20').Update(value=0)
                self.window.Element('SLIDER_12').Update(value=0)
                self.window.Element('SLIDER_10').Update(value=0)
                self.window.Element('SLIDER_8').Update(value=0)
                self.window.Element('SLIDER_6').Update(value=0)
                self.window.Element('SLIDER_4').Update(value=0)
            elif button is 'LINK':
                webbrowser.open_new("https://2090s-games.de")
            elif button is None or button is 'EXIT':
                break
        self.window.close()

    def output(self, max_value, slider, advantage):
        now = datetime.now()
        current_time = now.strftime("%d/%m/%Y - %H:%M:%S")
        dice = random.randint(1, max_value)
        text = str(dice+slider)
        log_text = "[ " + str(dice) + " + " + str(slider) + " ] --> " + str(dice + slider)
        fin_text = "[ " + text + " ] / [    ]"
        if advantage == True:
            dice2 = random.randint(1, max_value)
            text2 = str(dice2 + slider)
            fin_text = "[ " + text + " ] / [ " + text2 + " ]"
            log_text = current_time + ": [ " + str(dice) + " + " + str(slider) + " ] / [ " + str(dice2) + " + " + str(slider) + " ]"


        self.window.Element('TEXT').Update(value=fin_text)
        log_file = open('log.txt', 'a')
        log_file.write(log_text + "\n")

    def popup(self):
        try:
            with open("log.txt") as f:
                content = f.readlines()
            text = ""
            for x in content:
                text = text + x + ""
        except:
            text = "No Log"
        layout = [
                    [sg.Text("Log", key="new")],
                    [sg.Multiline(text, size=(50,7))]
                  ]
        window = sg.Window("Dice Log", layout, modal=True)
        choice = None
        while True:
            event, values = window.read()
            if event == "Exit" or event == sg.WIN_CLOSED:
                break

        window.close()




if __name__ == "__main__":
    gui = GUI()
    gui.start()
